import Home from './routes/home/home.component';
import { Route, Routes } from 'react-router-dom';

const Shop = () => {
  return (
    <h1>This is the Shop Page!!</h1>
  );
}

const App = () => {
  return (
    <Routes>
      <Route path='/' element={<Home />} />
      <Route path='/shop' element={<Shop />} />
    </Routes>
  );
}

export default App;
